const audioContext = new (window.AudioContext || window.webkitAudioContext)();
let step1Buffer = null;
let clapBuffer = null;

// Base64 de um som de passo simples
const step1WavBase64 = ``;


//Base64 para o CLAP
const clapWavBase64 = ``;

// Função para converter base64 em buffer
function base64ToArrayBuffer(base64) {
  const binary = atob(base64);
  const len = binary.length;
  const buffer = new Uint8Array(len);
  for (let i = 0; i < len; i++) {
    buffer[i] = binary.charCodeAt(i);
  }
  return buffer.buffer;
}

// Decodifica e armazena o buffer de áudio do passo impa
audioContext.decodeAudioData(base64ToArrayBuffer(step1WavBase64)).then(buffer => {step1Buffer = buffer;}).catch(err => {console.error("Erro ao decodificar áudio:", err);});
audioContext.decodeAudioData(base64ToArrayBuffer(clapWavBase64)).then(buffer => {clapBuffer = buffer;}).catch(err => {console.error("Erro ao decodificar áudio:", err);});


function playStepSound(isRunning = false) {
    if (step1Buffer == null) return;

    const source = audioContext.createBufferSource();
    source.buffer = step1Buffer;

    const gainNode = audioContext.createGain();
    gainNode.gain.value = isRunning ? 0.7 : 0.4;

    source.connect(gainNode).connect(audioContext.destination);
    source.start(0);
}

function playClapSound() {
    if (clapBuffer == null) return;

    const source = audioContext.createBufferSource();
    source.buffer = clapBuffer;

    const gainNode = audioContext.createGain();
    gainNode.gain.value = 1;

    source.connect(gainNode).connect(audioContext.destination);
    source.start(0);
}
